  var doc = "<h2>组件来源</h2>\n<ul>\n<li>本组件（Align）来源为<a href=\"https://github.com/react-component/align\">Github</a></li>\n<li>IMUI中会使用Align作为某些组件的定位工具，故这里提供一些官方之外的使用Demo，方便IMUI开发者参考.</li>\n</ul>\n<h2>属性说明</h2>\n<table>\n<thead>\n<tr><th style=\"text-align:left\">属性</th><th style=\"text-align:left\">说明</th><th style=\"text-align:left\">类型</th><th style=\"text-align:left\">默认值</th></tr>\n</thead>\n<tbody>\n<tr><td style=\"text-align:left\">align</td><td style=\"text-align:left\">定位相关参数,与<a href=\"https://github.com/yiminghe/dom-align\">dom-align</a>组件的属性配置相同</td><td style=\"text-align:left\"><code>Object</code></td><td style=\"text-align:left\"></td></tr>\n<tr><td style=\"text-align:left\">onAlign</td><td style=\"text-align:left\">发生align时的回调</td><td style=\"text-align:left\"><code>function(source:HTMLElement, align:Object)</code></td><td style=\"text-align:left\"></td></tr>\n<tr><td style=\"text-align:left\">target</td><td style=\"text-align:left\">获取定位的目标元素</td><td style=\"text-align:left\"><code>function():HTMLElement</code></td><td style=\"text-align:left\"><code>function(){return window;}</code></td></tr>\n<tr><td style=\"text-align:left\">monitorWindowResize</td><td style=\"text-align:left\">在resize时，是否进行align重排</td><td style=\"text-align:left\"><code>bool</code></td><td style=\"text-align:left\"><code>false</code></td></tr>\n<tr><td style=\"text-align:left\">align.points</td><td style=\"text-align:left\">定位参数,数组第一个字符串表示要定位的元素对准点，第二个表示定位目标元素对准点。字符串包含两个字符，第1个表示纵向信息，第2个表示横向信息，字符可能的值为： 't'(top), 'b'(bottom), 'c'(center), 'l'(left), 'r'(right)</td><td style=\"text-align:left\"><code>String[2]</code></td><td style=\"text-align:left\"></td></tr>\n<tr><td style=\"text-align:left\">align.offset</td><td style=\"text-align:left\">要定位的元素的偏移,第1个值表示横向偏移，第2个表示纵向偏移</td><td style=\"text-align:left\"><code>Number[2]</code></td><td style=\"text-align:left\"></td></tr>\n<tr><td style=\"text-align:left\">align.targetOffset</td><td style=\"text-align:left\">目标元素的偏移,第1个值表示横向偏移，第2个表示纵向偏移</td><td style=\"text-align:left\"><code>Number[2]</code></td><td style=\"text-align:left\"></td></tr>\n<tr><td style=\"text-align:left\">align.overflow</td><td style=\"text-align:left\">是否启用视窗边缘碰撞检测。adjustX属性为true表示启用横向检测，adjustY属性为true表示启用纵向检测</td><td style=\"text-align:left\"><code>Object</code></td><td style=\"text-align:left\"></td></tr>\n<tr><td style=\"text-align:left\">align.useCssRight</td><td style=\"text-align:left\">是否使用css right替代left定位</td><td style=\"text-align:left\"><code>bool</code></td><td style=\"text-align:left\">false</td></tr>\n<tr><td style=\"text-align:left\">align.useCssBottom</td><td style=\"text-align:left\">是否使用css bottom替代top定位</td><td style=\"text-align:left\"><code>bool</code></td><td style=\"text-align:left\">false</td></tr>\n<tr><td style=\"text-align:left\">align.useCssTransform</td><td style=\"text-align:left\">当浏览器支持时，是否使用css transform替代top,left,bottom,right定位</td><td style=\"text-align:left\"><code>bool</code></td><td style=\"text-align:left\">false</td></tr>\n</tbody>\n</table>\n<h2>原始文档</h2>\n<p>更多align详情请参考原始文档：</p>\n<ul>\n<li><a href=\"https://github.com/react-component/align\">https://github.com/react-component/align</a></li>\n<li><a href=\"https://github.com/yiminghe/dom-align\">https://github.com/yiminghe/dom-align</a></li>\n</ul>\n"; // @DOC@ 会在编译时被替换为 html 字符串，然后再被调用
