  var doc = "<h2>Label</h2>\n<table>\n<thead>\n<tr><th style=\"text-align:left\">属性</th><th style=\"text-align:left\">说明</th><th style=\"text-align:left\">类型</th><th style=\"text-align:left\">默认值</th></tr>\n</thead>\n<tbody>\n<tr><td style=\"text-align:left\">htmlFor</td><td style=\"text-align:left\">原生label元素的for属性，应为对应表单组件的name</td><td style=\"text-align:left\"><code>string</code></td><td style=\"text-align:left\"><code>''</code></td></tr>\n<tr><td style=\"text-align:left\">help</td><td style=\"text-align:left\">是否显示帮助链接(target都是_blank)</td><td style=\"text-align:left\"><code>string</code></td><td style=\"text-align:left\"><code>undefined</code></td></tr>\n<tr><td style=\"text-align:left\">required</td><td style=\"text-align:left\">是否显示必填标志</td><td style=\"text-align:left\"><code>bool</code></td><td style=\"text-align:left\"><code>undefined</code></td></tr>\n</tbody>\n</table>\n<h2>FormRow</h2>\n<table>\n<thead>\n<tr><th style=\"text-align:left\">属性</th><th style=\"text-align:left\">说明</th><th style=\"text-align:left\">类型</th><th style=\"text-align:left\">默认值</th></tr>\n</thead>\n<tbody>\n<tr><td style=\"text-align:left\">inline<strong>(还不支持!!!)</strong></td><td style=\"text-align:left\">是否设置此FormRow元素为<code>display: inline-block</code></td><td style=\"text-align:left\"><code>bool</code></td><td style=\"text-align:left\"><code>undefined</code></td></tr>\n</tbody>\n</table>\n<h2>Form</h2>\n<table>\n<thead>\n<tr><th style=\"text-align:left\">属性</th><th style=\"text-align:left\">说明</th><th style=\"text-align:left\">类型</th><th style=\"text-align:left\">默认值</th></tr>\n</thead>\n<tbody>\n<tr><td style=\"text-align:left\">horizontal</td><td style=\"text-align:left\">表单与Label排布是否水平</td><td style=\"text-align:left\"><code>bool</code></td><td style=\"text-align:left\"><code>true</code></td></tr>\n<tr><td style=\"text-align:left\">inline</td><td style=\"text-align:left\">FormRow之间是否水平</td><td style=\"text-align:left\"><code>bool</code></td><td style=\"text-align:left\"><code>undefined</code></td></tr>\n</tbody>\n</table>\n<h3>Form组件提供的API</h3>\n<p>注意：被Form.decorate包裹过的组件，value(或options.valuePropName提供)和onChange(或options.trigger提供)的props会被包裹的HOC组件控制，你依然可以：</p>\n<ol>\n<li>使用onChange绑定表单组件</li>\n<li>使用value和defaultValue prop控制表单</li>\n</ol>\n<table>\n<thead>\n<tr><th style=\"text-align:left\">方法</th><th style=\"text-align:left\">说明</th><th style=\"text-align:left\">类型</th></tr>\n</thead>\n<tbody>\n<tr><td style=\"text-align:left\">Form.decorate(klass, options)</td><td style=\"text-align:left\">对一个表单<code>ReactClass</code>进行封装，以支持Form的API</td><td style=\"text-align:left\">Function(klass: <code>ReactClass</code>, options: <code>object</code>): <code>ReactClass</code></td></tr>\n</tbody>\n</table>\n<h3>Form.decorate 's parameters</h3>\n<table>\n<thead>\n<tr><th style=\"text-align:left\">属性</th><th style=\"text-align:left\">说明</th><th style=\"text-align:left\">类型</th><th style=\"text-align:left\">默认值</th></tr>\n</thead>\n<tbody>\n<tr><td style=\"text-align:left\">options.valuePropName</td><td style=\"text-align:left\">子表单组件的value属性，比如checkbox为<code>checked</code></td><td style=\"text-align:left\"><code>string</code></td><td style=\"text-align:left\"><code>value</code></td></tr>\n<tr><td style=\"text-align:left\">options.trigger</td><td style=\"text-align:left\">收集子表单组件值的时机</td><td style=\"text-align:left\"><code>string</code></td><td style=\"text-align:left\"><code>onChange</code></td></tr>\n</tbody>\n</table>\n<h3>Form组件<strong>实例</strong>提供的API</h3>\n<blockquote>\n<p>注意：使用Form API时，表单组件使用Form命名空间下的组件，见最后一个demo</p>\n</blockquote>\n<table>\n<thead>\n<tr><th style=\"text-align:left\">API</th><th style=\"text-align:left\">说明</th><th style=\"text-align:left\">类型</th></tr>\n</thead>\n<tbody>\n<tr><td style=\"text-align:left\">getValues</td><td style=\"text-align:left\">获取此Form下的所有带name的表单组件的值</td><td style=\"text-align:left\">Function(): <code>object {name -&gt; value}</code></td></tr>\n<tr><td style=\"text-align:left\">setValues</td><td style=\"text-align:left\">设置此Form下的所有带name的表单组件的值</td><td style=\"text-align:left\">Function(): <code>object {name -&gt; value}</code></td></tr>\n<tr><td style=\"text-align:left\">getFieldValue(name)</td><td style=\"text-align:left\">获取对应表单的值</td><td style=\"text-align:left\">Function(name: <code>string</code>): <code>any</code></td></tr>\n<tr><td style=\"text-align:left\">setFieldValue(name, value)</td><td style=\"text-align:left\">设置对应表单的值</td><td style=\"text-align:left\">Function(name: <code>string</code>, value: <code>any</code>): <code>bool</code></td></tr>\n</tbody>\n</table>\n<p>几点说明：</p>\n<ul>\n<li>Form组件主要解决表单布局的问题，如果有什么新的建议或者想法提issue出来哈！</li>\n<li>Form组件为其所有子元素提供了一个context，<code>this.context.form</code>就是Form组件实例</li>\n<li>Form布局实现有更改<code>im-form--{修饰}</code>类下的表单组件如<code>im-checkgroup</code>，<code>im-radio-group</code>的样式，如果出现布局问题可以自行更改</li>\n</ul>\n"; // @DOC@ 会在编译时被替换为 html 字符串，然后再被调用
