  var doc = "<h2>Validator组件</h2>\n<p>原理说明：\n<code>Validator</code>会遍历其所有层级的带有<code>data-patterns</code>属性的表单子元素，通过HOC的方式将其变得可校验化</p>\n<h3>Validator属性</h3>\n<table>\n<thead>\n<tr><th style=\"text-align:left\">属性</th><th style=\"text-align:left\">说明</th><th style=\"text-align:left\">类型</th><th style=\"text-align:left\">默认值</th></tr>\n</thead>\n<tbody>\n<tr><td style=\"text-align:left\">checkers</td><td style=\"text-align:left\">自定义校验模式函数</td><td style=\"text-align:left\"><code>object</code></td><td style=\"text-align:left\"><code>{}</code></td></tr>\n<tr><td style=\"text-align:left\">onValid</td><td style=\"text-align:left\">当Validator下所有表单元素校验通过时，触发的回调</td><td style=\"text-align:left\"><code>function</code></td><td style=\"text-align:left\"><code>function() {}</code></td></tr>\n<tr><td style=\"text-align:left\">onInValid</td><td style=\"text-align:left\">当Validator下存在一个表单元素校验不通过时，触发的回调</td><td style=\"text-align:left\"><code>function</code></td><td style=\"text-align:left\"><code>function() {}</code></td></tr>\n<tr><td style=\"text-align:left\">msgAlign</td><td style=\"text-align:left\">默认提示信息的位置</td><td style=\"text-align:left\"><code>bottom</code>或者<code>right</code></td><td style=\"text-align:left\"><code>right</code></td></tr>\n</tbody>\n</table>\n<h3>表单元素校验属性</h3>\n<table>\n<thead>\n<tr><th style=\"text-align:left\">属性</th><th style=\"text-align:left\">说明</th><th style=\"text-align:left\">类型</th><th style=\"text-align:left\">默认值</th></tr>\n</thead>\n<tbody>\n<tr><td style=\"text-align:left\">data-patterns</td><td style=\"text-align:left\">校验模式，详见说明</td><td style=\"text-align:left\"><code>array</code></td><td style=\"text-align:left\"><code>undefined</code></td></tr>\n<tr><td style=\"text-align:left\">data-checking</td><td style=\"text-align:left\">传入false关闭校验</td><td style=\"text-align:left\"><code>bool</code></td><td style=\"text-align:left\"><code>undefined</code></td></tr>\n<tr><td style=\"text-align:left\">data-required</td><td style=\"text-align:left\">表单是否必填</td><td style=\"text-align:left\"><code>bool</code></td><td style=\"text-align:left\"><code>undefined</code></td></tr>\n<tr><td style=\"text-align:left\">data-placer</td><td style=\"text-align:left\">表单校验结果的回调，当此属性存在时，表单校验信息默认不展示</td><td style=\"text-align:left\"><code>function</code></td><td style=\"text-align:left\"><code>undefined</code></td></tr>\n<tr><td style=\"text-align:left\">data-prefix</td><td style=\"text-align:left\">表单校验化后，会被im-validator-enhancer包裹，可在表单前增加前缀元素</td><td style=\"text-align:left\"><code>React Element</code></td><td style=\"text-align:left\"><code>undefined</code></td></tr>\n<tr><td style=\"text-align:left\">data-suffix</td><td style=\"text-align:left\">表单校验化后，会被im-validator-enhancer包裹，可在表单后增加后缀元素</td><td style=\"text-align:left\"><code>React Element</code></td><td style=\"text-align:left\"><code>undefined</code></td></tr>\n</tbody>\n</table>\n<h3>Validator提供的API如下</h3>\n<table>\n<thead>\n<tr><th style=\"text-align:left\">方法</th><th style=\"text-align:left\">说明</th><th style=\"text-align:left\">类型</th></tr>\n</thead>\n<tbody>\n<tr><td style=\"text-align:left\">checkField(val, name)</td><td style=\"text-align:left\">手动触发某一表单元素的校验</td><td style=\"text-align:left\">Function(val: <code>any</code>, name: <code>string</code>): <code>undefined</code></td></tr>\n<tr><td style=\"text-align:left\">scrollToErrorField(idx, offset)</td><td style=\"text-align:left\">滚动到第<code>idx</code>个错误的表单元素<strong>(目前不支持offset参数)</strong></td><td style=\"text-align:left\">Function(idx: <code>number</code>, offset: <code>number</code>): <code>bool</code></td></tr>\n<tr><td style=\"text-align:left\">isAllValid</td><td style=\"text-align:left\">获取当前Validator下所有表单的是否全部通过校验</td><td style=\"text-align:left\">Function(): <code>bool</code></td></tr>\n</tbody>\n</table>\n<p>注意：</p>\n<ol>\n<li>需要校验的表单元素必须带有<code>name</code>属性</li>\n<li>Validator会重置表单的<code>onChange</code>, <code>ref</code>属性，重置前的属性依然有效，除了<code>ref</code>属性为<code>string</code>的情况</li>\n<li>被HOC封装后的表单元素，会在<code>componentDidMount</code>钩子中计算初始的有效值(<code>isValid</code>)，需要表单元素为非无状态组件且存在<code>getValue</code>方法，如果不支持，将会以<code>undefined</code>值传入校验模式中得出的结果为准</li>\n<li>表单元素的<code>data-patterns</code>属性支持内置的模式，详见checker.js源码</li>\n</ol>\n<h4>checkers属性使用示例</h4>\n<pre><code class=\"language-js\"><span class=\"token punctuation\" >{</span>\n  courseName<span class=\"token punctuation\" >:</span> <span class=\"token keyword\" >function</span><span class=\"token punctuation\" >(</span>val<span class=\"token punctuation\" >,</span> callback<span class=\"token punctuation\" >)</span> <span class=\"token punctuation\" >{</span>\n    $<span class=\"token punctuation\" >.</span><span class=\"token function\" >ajax</span><span class=\"token punctuation\" >(</span><span class=\"token punctuation\" >{</span>\n      <span class=\"token punctuation\" >.</span><span class=\"token punctuation\" >.</span><span class=\"token punctuation\" >.</span>\n    <span class=\"token punctuation\" >}</span><span class=\"token punctuation\" >)</span><span class=\"token punctuation\" >.</span><span class=\"token function\" >done</span><span class=\"token punctuation\" >(</span><span class=\"token keyword\" >function</span><span class=\"token punctuation\" >(</span>data<span class=\"token punctuation\" >)</span> <span class=\"token punctuation\" >{</span>\n      <span class=\"token function\" >callback</span><span class=\"token punctuation\" >(</span><span class=\"token punctuation\" >{</span>\n        isValid<span class=\"token punctuation\" >:</span> data<span class=\"token punctuation\" >.</span>isValid<span class=\"token punctuation\" >,</span>\n        msgs<span class=\"token punctuation\" >:</span> data<span class=\"token punctuation\" >.</span>msgs\n      <span class=\"token punctuation\" >}</span><span class=\"token punctuation\" >)</span><span class=\"token punctuation\" >;</span>\n    <span class=\"token punctuation\" >}</span><span class=\"token punctuation\" >)</span><span class=\"token punctuation\" >;</span>\n  <span class=\"token punctuation\" >}</span>\n<span class=\"token punctuation\" >}</span>\n</code></pre>\n<h4>data-patterns使用示例</h4>\n<pre><code>[{\n  key: 'courseName',\n  msg: '课程名称格式不正确'\n}, {\n  key: 'limit',\n  msg: '1-10字'\n  min: 1,\n  max: 10\n}, ...]\n</code></pre>\n<h4>data-placer函数的参数对象</h4>\n<table>\n<thead>\n<tr><th style=\"text-align:left\">属性</th><th style=\"text-align:left\">说明</th><th style=\"text-align:left\">类型</th></tr>\n</thead>\n<tbody>\n<tr><td style=\"text-align:left\">isValid</td><td style=\"text-align:left\">表单校验结果</td><td style=\"text-align:left\"><code>bool</code></td></tr>\n<tr><td style=\"text-align:left\">msgs</td><td style=\"text-align:left\">表单校验的所有提示信息数组</td><td style=\"text-align:left\"><code>function</code></td></tr>\n<tr><td style=\"text-align:left\">msgEl</td><td style=\"text-align:left\">原本应该显示的Msg元素</td><td style=\"text-align:left\"><code>React Element</code></td></tr>\n<tr><td style=\"text-align:left\">$field</td><td style=\"text-align:left\">触发校验的表单DOM元素</td><td style=\"text-align:left\"><code>DOM Node</code></td></tr>\n</tbody>\n</table>\n"; // @DOC@ 会在编译时被替换为 html 字符串，然后再被调用
